CREATE TABLE elenco_passaggi (
    `id_giada` INT,
    `cognome` VARCHAR(20) CHARACTER SET utf8,
    `nome` VARCHAR(14) CHARACTER SET utf8,
    `is_unitn` VARCHAR(5) CHARACTER SET utf8,
    `uid_badge` INT,
    `profilo_attuale` VARCHAR(22) CHARACTER SET utf8,
    `profilo_passaggio` VARCHAR(14) CHARACTER SET utf8,
    `progressivo_passaggio` INT,
    `data_passaggio` DATETIME,
    `anno_passaggio` INT,
    `mese_passaggio` INT,
    `giorno_passaggio` INT,
    `codice_mensa` INT,
    `descrizione_mensa` VARCHAR(22) CHARACTER SET utf8,
    `codice_postazione` INT,
    `id_prodotto` INT,
    `descrizione_prodotto` VARCHAR(9) CHARACTER SET utf8,
    `tipo_prodotto` VARCHAR(9) CHARACTER SET utf8,
    `importo_totale_da_passaggio` INT,
    `importo_totale_da_dettaglio` INT,
    `importo_prodotto_da_dettaglio` INT,
    `codice_fornitore` INT,
    `fornitore` VARCHAR(16) CHARACTER SET utf8,
    `cod_profilo_passaggio` INT,
    `convenzione_fatturazione` VARCHAR(36) CHARACTER SET utf8,
    `tag_unitn` VARCHAR(15) CHARACTER SET utf8,
    `sesso` VARCHAR(1) CHARACTER SET utf8
);
